  assertFalse(unzipPath.child("a").child("_b").exists());
  assertTrue(unzipPath.child("b").child("ba").child("ba.txt").exists());
  assertFalse(unzipPath.child("b").child("_a").exists());
  assertFalse(unzipPath.child("b").child("_aatxt").exists());
}
